import React, { useState, useEffect } from "react";
import Janela from "./janela/janela"; // Importando Janela

function Meio({ dados }) {
  // Nome do estado alterado para evitar conflito com o props "dados"
  const [dadosInternos, setDadosInternos] = useState(dados || null);

  // Caso precise carregar mais dados ou fazer alguma lógica
  useEffect(() => {
    if (!dados) {
      fetch("/caminho/para/cliente.json")
        .then((response) => response.json())
        .then((data) => setDadosInternos(data))
        .catch((error) => console.error("Erro ao carregar os dados", error));
    }
  }, [dados]);

  return (
    <div className="meio">
      {/* Passando os dados para o Janela */}
      <Janela dados={dadosInternos} />
    </div>
  );
}

export default Meio;
